import React from 'react';
import Link from 'next/link';

const Menu = () => {
  return (
    <nav>
      <Link href="/">
        <a>Home</a>
      </Link>
      &nbsp;
      <Link href="/sobre">
        <a>Sobre</a>
      </Link>
    </nav>
  );
};

export default Menu;
